            array('id' => '2','announcement_category_id' => '4','slug' => 'regularly-review-statements','data' => '{"language":{"en":{"title":"Banking On the Go: iBanking\'s Mobile App Experience","description":"<p>Banking has never been easier or more convenient. With the iBanking mobile app, you can manage your finances from anywhere, at any time. Transfer funds, pay bills, check account balances, and access your account statements\\u2014all from the palm of your hand. Our app is designed for ease of use, with a simple interface that makes mobile banking intuitive and efficient. Whether you\'re at home, at work, or on the go, iBanking ensures you have secure access to your financial world wherever you are.<\\/p>","tags":["Help Center"]},"es":{"title":"Banca m\\u00f3vil: la experiencia de la aplicaci\\u00f3n m\\u00f3vil de iBanking","description":"<p>Realizar operaciones bancarias nunca ha sido tan f\\u00e1cil ni tan conveniente. Con la aplicaci\\u00f3n m\\u00f3vil iBanking, puede administrar sus finanzas desde cualquier lugar y en cualquier momento. Transfiera fondos, pague facturas, verifique los saldos de sus cuentas y acceda a sus estados de cuenta, todo desde la palma de su mano. Nuestra aplicaci\\u00f3n est\\u00e1 dise\\u00f1ada para que sea f\\u00e1cil de usar, con una interfaz simple que hace que la banca m\\u00f3vil sea intuitiva y eficiente. Ya sea que est\\u00e9 en su casa, en el trabajo o de viaje, iBanking le garantiza un acceso seguro a su mundo financiero dondequiera que est\\u00e9.<\\/p>","tags":["Centro de ayuda"]},"ar":{"title":"\\u0627\\u0644\\u0645\\u0639\\u0627\\u0645\\u0644\\u0627\\u062a \\u0627\\u0644\\u0645\\u0635\\u0631\\u0641\\u064a\\u0629 \\u0623\\u062b\\u0646\\u0627\\u0621 \\u0627\\u0644\\u062a\\u0646\\u0642\\u0644: \\u062a\\u062c\\u0631\\u0628\\u0629 \\u062a\\u0637\\u0628\\u064a\\u0642 iBanking \\u0644\\u0644\\u062c\\u0648\\u0627\\u0644","description":"<p>\\u0644\\u0645 \\u062a\\u0643\\u0646 \\u0627\\u0644\\u0645\\u0639\\u0627\\u0645\\u0644\\u0627\\u062a \\u0627\\u0644\\u0645\\u0635\\u0631\\u0641\\u064a\\u0629 \\u0623\\u0633\\u0647\\u0644 \\u0623\\u0648 \\u0623\\u0643\\u062b\\u0631 \\u0645\\u0644\\u0627\\u0621\\u0645\\u0629 \\u0645\\u0646 \\u0623\\u064a \\u0648\\u0642\\u062a \\u0645\\u0636\\u0649. \\u0645\\u0639 \\u062a\\u0637\\u0628\\u064a\\u0642 iBanking \\u0644\\u0644\\u062c\\u0648\\u0627\\u0644\\u060c \\u064a\\u0645\\u0643\\u0646\\u0643 \\u0625\\u062f\\u0627\\u0631\\u0629 \\u0634\\u0624\\u0648\\u0646\\u0643 \\u0627\\u0644\\u0645\\u0627\\u0644\\u064a\\u0629 \\u0645\\u0646 \\u0623\\u064a \\u0645\\u0643\\u0627\\u0646 \\u0648\\u0641\\u064a \\u0623\\u064a \\u0648\\u0642\\u062a. \\u064a\\u0645\\u0643\\u0646\\u0643 \\u062a\\u062d\\u0648\\u064a\\u0644 \\u0627\\u0644\\u0623\\u0645\\u0648\\u0627\\u0644 \\u0648\\u062f\\u0641\\u0639 \\u0627\\u0644\\u0641\\u0648\\u0627\\u062a\\u064a\\u0631 \\u0648\\u0627\\u0644\\u062a\\u062d\\u0642\\u0642 \\u0645\\u0646 \\u0623\\u0631\\u0635\\u062f\\u0629 \\u0627\\u0644\\u062d\\u0633\\u0627\\u0628\\u0627\\u062a \\u0648\\u0627\\u0644\\u0648\\u0635\\u0648\\u0644 \\u0625\\u0644\\u0649 \\u0643\\u0634\\u0648\\u0641 \\u0627\\u0644\\u062d\\u0633\\u0627\\u0628\\u0627\\u062a \\u0627\\u0644\\u062e\\u0627\\u0635\\u0629 \\u0628\\u0643 - \\u0643\\u0644 \\u0630\\u0644\\u0643 \\u0645\\u0646 \\u0631\\u0627\\u062d\\u0629 \\u064a\\u062f\\u0643. \\u062a\\u0645 \\u062a\\u0635\\u0645\\u064a\\u0645 \\u062a\\u0637\\u0628\\u064a\\u0642\\u0646\\u0627 \\u0644\\u0633\\u0647\\u0648\\u0644\\u0629 \\u0627\\u0644\\u0627\\u0633\\u062a\\u062e\\u062f\\u0627\\u0645\\u060c \\u0645\\u0639 \\u0648\\u0627\\u062c\\u0647\\u0629 \\u0628\\u0633\\u064a\\u0637\\u0629 \\u062a\\u062c\\u0639\\u0644 \\u0627\\u0644\\u0645\\u0639\\u0627\\u0645\\u0644\\u0627\\u062a \\u0627\\u0644\\u0645\\u0635\\u0631\\u0641\\u064a\\u0629 \\u0639\\u0628\\u0631 \\u0627\\u0644\\u062c\\u0648\\u0627\\u0644 \\u0628\\u062f\\u064a\\u0647\\u064a\\u0629 \\u0648\\u0641\\u0639\\u0627\\u0644\\u0629. \\u0633\\u0648\\u0627\\u0621 \\u0643\\u0646\\u062a \\u